const SignUp = () => {
    let [name,setName] = useState("");
    let [email,setEmail] = useState("");
    let [password,setPassword] = useState("");
    return (
        <div className="register">
            <h1>Register</h1>
            <input className="inputBox" type="text" onChange={(e)=>setName(e.target.value)} placeholder="Enter Name" />
            <input className="inputBox" type="text" placeholder="Enter E-mail" />
            <input className="inputBox" type="password" placeholder="Enter Password" />
            <button className="appbutton" type="button">SignUp</button>
        </div>
    );
}

export default SignUp;
